//   </Tab.Navigator>
//   )
// }

export default function App() {

  return (
    <div>
    {/* <NavigationContainer>
      <Stack.Navigator initialRouteName='Home' screenOptions={{headerShown:false}}>
          <Stack.Screen name='Home' component={Tabs} />
          <Stack.Screen name='information' component={Tabs}/>
      </Stack.Navigator>
    </NavigationContainer> */}
      <MyDrawer />
    </div>

  );
}


